To determine the asymptotes of the function \( f(x) = \frac{2x}{x^2 - 5x - 14} \), we need to analyze both the vertical and horizontal asymptotes.

**Step 1: Find the vertical asymptotes.**
Vertical asymptotes occur where the denominator is zero, provided the numerator is not also zero at those points. We need to solve the equation \( x^2 - 5x - 14 = 0 \).

Factoring the quadratic equation, we get:
\[ x^2 - 5x - 14 = (x - 7)(x + 2) = 0. \]
So, the solutions are \( x = 7 \) and \( x = -2 \). Therefore, the vertical asymptotes are \( x = 7 \) and \( x = -2 \).

**Step 2: Find the horizontal asymptote.**
To find the horizontal asymptote, we look at the degrees of the numerator and the denominator. The degree of the numerator is 1 and the degree of the denominator is 2. Since the degree of the numerator is less than the degree of the denominator, the horizontal asymptote is \( y = 0  \).

**Step 3: Identify the asymptotes and calculate \( a + b + c \).**
The vertical asymptotes are \( x = 7 \) and \( x = -2 \), so \( a = 7 \) and \( b = -2 \). The horizontal asymptote is \( y = 0 \), so \( c = 0 \).

Therefore, \( a + b + c = 7 + (-2) + 0 = 5 \).

The final answer is:
\[ \boxed{5} \]```


